import "./App.css";
import Movies from "./compenents/movies";

function App() {
	return (
		<div class='container mt-4'>
			<div class='notification is-primary'>
				This container is <strong>centered</strong> on desktop and larger viewports.
        <Movies />
			</div>
		</div>
	);
}

export default App;
